import React from 'react';
import clsx from 'clsx';
import PropTypes from 'prop-types';
import WaffleChart from './WaffleChart';
import {
    Box,
    Button,
    Card,
    CardContent,
    CardHeader,
    Divider,
    useTheme,
    makeStyles,
    colors
} from '@material-ui/core';
import ArrowDropDownIcon from '@material-ui/icons/ArrowDropDown';
import ArrowRightIcon from '@material-ui/icons/ArrowRight';
import CircularProgress from '@material-ui/core/CircularProgress';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';



const useStyles = makeStyles(() => ({
    root: {}
}));

function waffleData(dataset,selector){
    let arr = []
    dataset.forEach(function (d) {
        d.values.forEach(function (e) {
            let o = {}
            o.diagnosis = d.diagnosis
            o.age = e.age
            o.total = e.value
            arr.push(o)
        })
    });
    console.log("arr", arr)
    console.log(selector)
    let arr_filtered = arr.filter(function (e) {
        return e.age >= selector[0][0] && e.age <= selector[0][1];
    });

    let output = []

    arr_filtered.forEach(function (item) {
        var exist = output.filter(function (v, i) {
            return v.diagnosis == item.diagnosis
        });
        if (exist.length) {
            var index = output.indexOf(exist[0]);
            var total = output[index].total + item.total;
            Object.assign(output[index], item);
            output[index].total = total;
        } else {
            if (typeof item.value == 'string') {
                item.value = [item.value];
            }
            output.push(item);
        }
    });
    return output
}

const DiagnosesWaffleChart = ({ className, ...rest }) => {
    const classes = useStyles();
    const theme = useTheme();

    let selectordata = [[0, 2], [2, 6], [6, 12], [12, 18], [18, 21], [22, 35], [36, 55], [55, 65], [65, 75], [75,100]]

    let [loading, setLoading] = React.useState(true);
    let [data, setData] = React.useState([]);
    let [selector, setSelector] = React.useState(selectordata);

    React.useEffect(() => {
        let apiUrl = 'https://visualizing-healthcare-data.wm.r.appspot.com/data/icu_mortality';
        fetch(apiUrl)
            .then((response) => response.json())
            .then(result => {
                setData(waffleData(result, selector));
                setLoading(false);
            })
    }, [])

    const handleChange = (event) => {
        setSelector(event.target.value);
    };

    return (
        <Card
            className={clsx(classes.root, className)}
            {...rest}
        >
            <CardHeader
                action={(
                    <Select
                        endIcon={<ArrowDropDownIcon />}
                        value={selector}
                        onChange={handleChange}
                    >
                        <MenuItem value={selector[0]}>{selector[0]}</MenuItem>
                        <MenuItem value={selector[1]}>{selector[1]}</MenuItem>
                        <MenuItem value={selector[2]}>{selector[2]}</MenuItem>
                        <MenuItem value={selector[3]}>{selector[3]}</MenuItem>
                        <MenuItem value={selector[4]}>{selector[4]}</MenuItem>
                        <MenuItem value={selector[5]}>{selector[5]}</MenuItem>
                        <MenuItem value={selector[6]}>{selector[6]}</MenuItem>
                        <MenuItem value={selector[7]}>{selector[7]}</MenuItem>
                        <MenuItem value={selector[8]}>{selector[8]}</MenuItem>
                        <MenuItem value={selector[9]}>{selector[9]}</MenuItem>
                    </Select>
                )}
                title="Q8 Drugs Waffle Chart"
            />
            <Divider />
            <CardContent id={"wc"}>
                {/* <Box
          id={"gbc"}
          height={400}
          position="relative"
        > */}
                {!loading ? <WaffleChart dataset={data} selector={selector} size={[450, 500]} /> : <CircularProgress />}
                {/* </Box> */}
            </CardContent>
            <Divider />
            <Box
                display="flex"
                justifyContent="flex-end"
                p={2}
            >
                {/* <Button
          color="primary"
          endIcon={<ArrowRightIcon />}
          size="small"
          variant="text"
        >
          Overview
        </Button> */}
            </Box>
        </Card>
    );
};

DiagnosesWaffleChart.propTypes = {
    className: PropTypes.string
};

export default DiagnosesWaffleChart;
